text:
@NommingNomad Approved!

Love  this coffee shop. It is a perfect place to grab a drink and a bite to eat and settle down to get some work done. Which is what I do a lot. The people are nice and friendly and the vibe is chill and relaxed. There are some outlets but not abundant. The space has the barista bar in the middle with a couch setting as soon as you enter and there is some bar seating. Then on to regular 2 seater tables. But my favorite spot is the one that is almost hidden one behind the wall, in the corner on a pedestal. So cozy. 

They also have some couches in the back with some other assorted seating. All in all I think this is one of the few places with wifi that actually works and is nice to sit and get some work done.
